import React, { useState } from 'react';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';

function CustomNavbar() {
  const [count, setCount] = useState(0);

  const handleIncrement = () => {
    setCount(count + 1);
  };

  const handleDecrement = () => {
    setCount(count - 1);
  };

  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#">Mon Site</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#">Accueil</Nav.Link>
            <Nav.Link href="#">Ã€ propos</Nav.Link>
            <Nav.Link href="#">Contact</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link>
              <Button variant="outline-primary" onClick={handleDecrement}>-</Button>
            </Nav.Link>
            <Nav.Link>
              <Button variant="outline-primary">{count}</Button>
            </Nav.Link>
            <Nav.Link>
              <Button variant="outline-primary" onClick={handleIncrement}>+</Button>
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navbare;
